import React from 'react';
import { Provider } from 'react-redux';
import store from './store';




import { Header, Categories, Products, Footer} from './components/CompontentIndex';


function App() {
    return (
        <Provider store={store}>
            <div className='App'>

                <h1>Hello World</h1>
                <Categories />
                <Products />
                <Footer /> 
            </div>
        </Provider>
    );
}

export default App;
